import React from 'react';
import Box from '@mui/material/Box';
import Card from '@mui/material/Card';
import CardContent from '@mui/material/CardContent';
import Typography from '@mui/material/Typography';
import Chip from '@mui/material/Chip';
import AudiotrackIcon from '@mui/icons-material/Audiotrack';
import Accordion from '@mui/material/Accordion';
import AccordionSummary from '@mui/material/AccordionSummary';
import AccordionDetails from '@mui/material/AccordionDetails';
import ExpandMoreIcon from '@mui/icons-material/ExpandMore';
import { PieChart, Pie, Cell, BarChart, Bar, XAxis, YAxis, Tooltip, ResponsiveContainer } from 'recharts';
// Colors for charts
const COLORS = ['#43a047', '#e53935', '#fbc02d', '#1e88e5', '#8e24aa'];

export default function ComprehensiveReportDisplay({ report }) {
    // Helper: Extract model summary and frame-by-frame details from full_report
    let modelSummary = '';
    let frameDetails = [];
    let audioSummary = '';
    let recommendations = '';
    if (report.full_report) {
        // Extract overall compliance, status, violations, categories
        const summaryMatch = report.full_report.match(/Overall Compliance: ([\d\.]+)%\s*Status: ([^\n]+)\s*Total Violations: (\d+)\s*Violation Categories: ([^\n]+)/);
        if (summaryMatch) {
            modelSummary = `Compliance: ${summaryMatch[1]}% | Status: ${summaryMatch[2]} | Violations: ${summaryMatch[3]} | Categories: ${summaryMatch[4]}`;
        }
        // Extract recommendations
        const recMatch = report.full_report.match(/RECOMMENDATIONS:[\s\S]*?((?:Visual policy violations detected:[^\n]*\n)?(?:Audio policy violations detected:[^\n]*\n)?(?:Review transcript for policy-violating language\n)?(?:Multiple violations detected[^\n]*\n)?)/);
        if (recMatch) {
            recommendations = recMatch[1].trim();
        }
        // Extract audio analysis
        const audioMatch = report.full_report.match(/AUDIO ANALYSIS:[\s\S]*?Transcript excerpt:([^\n]*)[\s\S]*?Policy: ([^\n]*)[\s\S]*?Examples: ([^\n]*)[\s\S]*?Action Required: ([^\n]*)/);
        if (audioMatch) {
            audioSummary = `Transcript: ${audioMatch[1].trim()} | Policy: ${audioMatch[2].trim()} | Examples: ${audioMatch[3].trim()} | Action: ${audioMatch[4].trim()}`;
        }
        // Extract frame-by-frame details
        const frameRegex = /Frame (\d+) \(t=([\d\.]+)s\): ([^\n]+)[\s\S]*?BLIP: ([^\n]*)[\s\S]*?Policy: ([^\n]*)[\s\S]*?Examples: ([^\n]*)[\s\S]*?Action Required: ([^\n]*)/g;
        let match;
        while ((match = frameRegex.exec(report.full_report)) !== null) {
            frameDetails.push({
                frame: match[1],
                time: match[2],
                category: match[3].trim(),
                blip: match[4].trim(),
                policy: match[5].trim(),
                examples: match[6].trim(),
                action: match[7].trim()
            });
        }
    }
    if (!report) return null;

    // Always prefer model output from analysis_json if present
    let fields = {};
    if (report.analysis_json) {
        fields = report.analysis_json;
    } else if (report.full_report) {
        // Try to parse model output from full_report if analysis_json missing
        try {
            const match = report.full_report.match(/MODEL OUTPUT JSON:(\s*\{[\s\S]*?\})/);
            if (match) {
                fields = JSON.parse(match[1]);
            }
        } catch (e) {
            fields = {};
        }
    }
    const fallback = report.parsedReport || {};

    // Statistics
    const violationCount = Array.isArray(fields.frame_analysis?.violation_categories)
        ? fields.frame_analysis.violation_categories.length
        : 0;
    const safeFrames = typeof fields.frame_analysis?.safe_frames === 'number' ? fields.frame_analysis.safe_frames : 0;
    const totalFrames = typeof fields.frame_analysis?.total_frames === 'number' ? fields.frame_analysis.total_frames : 0;
    const complianceRate = totalFrames > 0 ? Math.round((safeFrames / totalFrames) * 100) : 0;

    // Content extraction
    const transcript = fields.audio_analysis?.transcript || fields.transcript || fallback.transcript || '';
    const ocrText = fields.ocr_results?.text || fields.text_in_video?.text || fallback.ocr_text || '';
    const ocrItems = fields.ocr_results?.extracted_items || fields.text_in_video?.extracted_items || fallback.ocr_items || [];
    const blipDescriptions = fields.frame_analysis?.blip_descriptions || fallback.blip_descriptions || [];
    // Copyright: prefer model output if present
    const copyrightCheck = fields.copyright_check || report.copyright_check || null;

    // Prepare chart data (after complianceRate and fields are defined)
    const complianceData = [
        { name: 'Compliant', value: complianceRate, color: '#43a047' },
        { name: 'Non-Compliant', value: 100 - complianceRate, color: '#e53935' }
    ];
    const violationCategories = Array.isArray(fields.frame_analysis?.violation_categories) ? fields.frame_analysis.violation_categories : [];
    const violationData = violationCategories.map((cat, idx) => ({ name: cat, value: 1, color: COLORS[idx % COLORS.length] }));
    const scoreData = [
        { name: 'Text', value: fields.text_score || 0 },
        { name: 'Image', value: fields.image_score || 0 }
    ];

    // Transcript safety logic (define helpers)
    const badWords = fields.audio_analysis?.bad_words || [];
    const badPatterns = fields.audio_analysis?.bad_patterns || [];
    const isInappropriate = badWords.length > 0 || badPatterns.length > 0;
    let transcriptSafetyStatus = '';
    if (transcript === '') {
        transcriptSafetyStatus = 'No transcript available';
    } else if (isInappropriate) {
        if (badWords.length > 0) {
            transcriptSafetyStatus = 'Flagged: Inappropriate language detected';
        } else if (badPatterns.length > 0) {
            transcriptSafetyStatus = 'Close: Censored or partial inappropriate language detected';
        } else {
            transcriptSafetyStatus = 'Flagged: Inappropriate language detected';
        }
    } else {
        transcriptSafetyStatus = 'Safe: No inappropriate language detected';
    }

    return (
        <Box sx={{ width: '100vw', minHeight: '100vh', background: '#f7f8fa', display: 'flex', flexDirection: 'column', alignItems: 'center', p: 2 }}>
            {/* Only show the professional model output dashboard */}
            {report.full_report && (
                <Card sx={{ width: '100%', maxWidth: 1200, mb: 3, background: '#f5f5f5', border: '2px solid #1976d2', boxShadow: 3 }}>
                    <CardContent>
                        <Typography variant="h5" sx={{ fontWeight: 'bold', color: '#1976d2', mb: 2 }}>Ultimate Model Analysis Report</Typography>
                        {modelSummary && <Typography variant="body1" sx={{ mb: 2, fontWeight: 'bold', color: '#d32f2f' }}>{modelSummary}</Typography>}
                        {recommendations && <Typography variant="body2" sx={{ mb: 2, color: '#e53935', fontWeight: 'bold' }}>{recommendations}</Typography>}
                        {audioSummary && <Typography variant="body2" sx={{ mb: 2, color: '#1e88e5', fontWeight: 'bold' }}>{audioSummary}</Typography>}
                        {frameDetails.length > 0 && (
                            <Box sx={{ mt: 2 }}>
                                <Typography variant="subtitle1" sx={{ fontWeight: 'bold', mb: 2, color: '#1976d2' }}>Frame-by-Frame Analysis</Typography>
                                <Box sx={{ display: 'flex', flexWrap: 'wrap', gap: 2 }}>
                                    {frameDetails.map((fd, idx) => (
                                        <Card key={idx} sx={{ minWidth: 220, maxWidth: 260, mb: 2, boxShadow: 2, background: '#e3f2fd', border: '1px solid #1976d2' }}>
                                            <CardContent>
                                                <Typography variant="subtitle2" sx={{ fontWeight: 'bold', color: '#1976d2' }}>Frame {fd.frame} (t={fd.time}s)</Typography>
                                                <Typography variant="body2" sx={{ fontWeight: 'bold', color: '#e53935' }}>Category: {fd.category}</Typography>
                                                <Typography variant="body2" sx={{ fontStyle: 'italic', mb: 1 }}>BLIP: {fd.blip}</Typography>
                                                <Typography variant="body2">Policy: <b>{fd.policy}</b></Typography>
                                                <Typography variant="body2">Examples: <b>{fd.examples}</b></Typography>
                                                <Typography variant="body2">Action: <b>{fd.action}</b></Typography>
                                            </CardContent>
                                        </Card>
                                    ))}
                                </Box>
                            </Box>
                        )}
                    </CardContent>
                </Card>
            )}
        </Box>
    );
}
